// 2. Rotate X
let cX = cos(u.rotX);
let sX = sin(u.rotX);
let ry = pos.y * cX - pos.z * sX;
let rz = pos.y * sX + pos.z * cX;
pos.y = ry;
pos.z = rz;

// 3. Rotate Y
let cY = cos(u.rotY);
let sY = sin(u.rotY);
let rx = pos.x * cY + pos.z * sY;
let rz2 = -pos.x * sY + pos.z * cY;
